window.bookSummaryJSON = "<p>The magical world of Volar is dying. To save themselves and their followers, the native gods have instituted a plan, one that will transform Earth mortals into anchors for their powers.</p> <p>Ty and thousands of other humans are summoned through portals and given one mission: choose a god and power up as fast as they can.</p> <p>An <i>isekai</i>/portal/progression series, <i>Divine Invasion</i> is the first book in a fast-paced adventure story set in both our world and Volar. Expect demons, dragons, dungeons, and unexpected plot twists to take the story in new and strange directions at every turn.&nbsp;</p> <p>The gods gave him six months to prepare for their twisted games. What he does next will surprise them all.</p>"; 
